   355→        // Update timeline position when filter bar is toggled
   356→        function updateTimelinePosition() {
   357→            const container = document.getElementById('timeline-container');
   358→            const filterToolbar = document.querySelector('.filter-toolbar');
   359→
   360→            if (container && filterToolbar) {
   361→                const filterHeight = filterToolbar.offsetHeight;
   362→                const computedStyle = getComputedStyle(filterToolbar);
   363→                const isFilterVisible = computedStyle.display !== 'none' &&
   364→                    computedStyle.visibility !== 'hidden' &&
   365→                    filterHeight > 0;
   366→
   367→                container.style.top = isFilterVisible ? `${filterHeight}px` : '0px';
   368→            }
