   371→        // Initialize timeline resizing functionality
   372→        function initTimelineResize() {
   373→            const container = document.getElementById('timeline-container');
   374→            const resizeHandle = document.getElementById('timeline-resize-handle');
   375→
   376→            if (!container || !resizeHandle) return;
   377→
   378→            let startY = 0;
   379→            let startHeight = 0;
   380→
   381→            function handleMouseDown(e) {
   382→                isResizing = true;
   383→                startY = e.clientY;
   384→                startHeight = container.offsetHeight;
   385→
   386→                document.addEventListener('mousemove', handleMouseMove);
   387→                document.addEventListener('mouseup', handleMouseUp);
   388→
   389→                // Prevent text selection during resize
   390→                document.body.style.userSelect = 'none';
   391→                e.preventDefault();
   392→            }
   393→
   394→            function handleMouseMove(e) {
   395→                if (!isResizing) return;
   396→
   397→                const deltaY = e.clientY - startY;
   398→                const newHeight = Math.max(150, Math.min(window.innerHeight * 0.8, startHeight + deltaY));
   399→
   400→                container.style.height = newHeight + 'px';
   401→
   402→                // Trigger timeline redraw if needed
   403→                if (timeline) {
   404→                    timeline.redraw();
   405→                }
   406→            }
   407→
   408→            function handleMouseUp() {
   409→                isResizing = false;
   410→                document.removeEventListener('mousemove', handleMouseMove);
   411→                document.removeEventListener('mouseup', handleMouseUp);
   412→                document.body.style.userSelect = '';
   413→            }
   414→
   415→            // Add mouse event listeners
   416→            resizeHandle.addEventListener('mousedown', handleMouseDown);
   417→
   418→            // Also allow resizing by dragging the container bottom edge
   419→            container.addEventListener('mousedown', function (e) {
   420→                const rect = container.getBoundingClientRect();
   421→                if (e.clientY >= rect.bottom - 8) {
   422→                    handleMouseDown(e);
   423→                }
   424→            });
   425→        }
