   203→        function onTimelineSelect(event) {
   204→            const selection = timeline.getSelection();
   205→            if (selection.length > 0) {
   206→                const itemId = selection[0];
   207→                const messageEl = timelineIdToElement.get(itemId);
   208→                if (messageEl) {
   209→                    // Calculate timeline height for proper scroll positioning
   210→                    const timelineContainer = document.getElementById('timeline-container');
   211→                    const timelineHeight = timelineContainer ? timelineContainer.offsetHeight : 0;
   212→
   213→                    // Scroll so message top aligns with timeline bottom
   214→                    const elementTop = messageEl.offsetTop;
   215→                    const scrollPosition = elementTop - timelineHeight - 10; // 10px padding
   216→
   217→                    window.scrollTo({
   218→                        top: Math.max(0, scrollPosition),
   219→                        behavior: 'smooth'
   220→                    });
   221→
   222→                    // Highlight the message briefly
   223→                    messageEl.style.backgroundColor = '#fff3cd';
   224→                    setTimeout(() => {
   225→                        messageEl.style.backgroundColor = '';
   226→                    }, 2000);
   227→                }
   228→            }
   229→        }
   230→
   231→        // Initialize timeline
   232→        function initTimeline() {
   233→            if (timeline) return; // Already initialized
   234→
   235→            console.log('Initializing vis-timeline...');
   236→
   237→            const container = document.getElementById('timeline-visualization');
   238→            if (!container) {
   239→                console.error('Timeline container not found');
   240→                return;
   241→            }
   242→
   243→            // Build timeline data
   244→            const { items, groups, timelineEnd, timelineStart } = buildTimelineData();
   245→            if (items.length === 0) {
   246→                console.warn('No timeline items found');
   247→                return;
   248→            }
   249→
   250→            // Timeline options
   251→            const options = {
   252→                height: '100%',
   253→                stack: true,
   254→                showCurrentTime: true,
   255→                zoomMin: 1000 * 1, // 1 second
   256→                zoomMax: 1000 * 60 * 60 * 24 * 30, // 30 days
   257→                start: timelineStart,
   258→                end: timelineEnd,
   259→                orientation: 'top',
   260→                align: 'left',
   261→                margin: {
   262→                    item: 2,
   263→                    axis: 2
   264→                },
   265→                groupOrder: (a, b) => {
   266→                    const order = ['user', 'assistant', 'sidechain', 'tool_use', 'tool_result', 'thinking', 'system', 'image'];
   267→                    return order.indexOf(a.id) - order.indexOf(b.id);
   268→                }
   269→            };
   270→
   271→            // Create timeline
   272→            timeline = new vis.Timeline(container, new vis.DataSet(items), new vis.DataSet(groups), options);
   273→
   274→            // Add event listeners
   275→            timeline.on('select', onTimelineSelect);
   276→
   277→            // Apply current filters
   278→            applyFilters();
   279→
   280→            console.log('Timeline initialized with', items.length, 'items and', groups.length, 'groups');
   281→        }
   282→
   283→        // Load vis-timeline library dynamically
   284→        function loadVisTimeline() {
   285→            return new Promise((resolve, reject) => {
   286→                if (window.vis && window.vis.Timeline) {
   287→                    resolve();
   288→                    return;
   289→                }
   290→
   291→                console.log('Loading vis-timeline from CDN...');
   292→
   293→                // Load CSS first
   294→                const link = document.createElement('link');
   295→                link.rel = 'stylesheet';
   296→                link.href = 'https://unpkg.com/vis-timeline/styles/vis-timeline-graph2d.min.css';
   297→                document.head.appendChild(link);
   298→
   299→                // Load JavaScript
   300→                const script = document.createElement('script');
   301→                script.src = 'https://unpkg.com/vis-timeline/standalone/umd/vis-timeline-graph2d.min.js';
   302→                script.onload = () => {
   303→                    console.log('vis-timeline loaded successfully');
   304→                    isTimelineLoaded = true;
   305→                    resolve();
   306→                };
   307→                script.onerror = () => {
   308→                    console.error('Failed to load vis-timeline');
   309→                    reject(new Error('Failed to load vis-timeline'));
   310→                };
   311→                document.head.appendChild(script);
   312→            });
   313→        }
   314→
   315→        // Toggle timeline visibility
   316→        function toggleTimeline() {
   317→            const container = document.getElementById('timeline-container');
   318→            const button = document.getElementById('toggleTimeline');
   319→
   320→            if (container.style.display === 'none') {
   321→                // Show timeline
   322→                button.classList.add('active');
   323→                button.title = 'Hide timeline';
   324→                button.textContent = '🗓️';
   325→
   326→                // Load vis-timeline if needed and show timeline
   327→                loadVisTimeline().then(() => {
   328→                    container.style.display = 'block';
   329→                    // Set default height if not already set
   330→                    if (!container.style.height) {
   331→                        container.style.height = '30vh';
   332→                    }
   333→                    // Wait for container to be visible, then initialize
   334→                    setTimeout(() => {
   335→                        initTimeline();
   336→                        initTimelineResize();
   337→                    }, 100);
   338→                }).catch(error => {
   339→                    console.error('Error loading timeline:', error);
   340→                    alert('Failed to load timeline. Please check your internet connection.');
   341→                    container.style.display = 'none';
   342→                    button.classList.remove('active');
   343→                    button.title = 'Show timeline';
   344→                    button.textContent = '📆';
   345→                });
   346→            } else {
   347→                // Hide timeline
   348→                container.style.display = 'none';
   349→                button.classList.remove('active');
   350→                button.title = 'Show timeline';
   351→                button.textContent = '📆';
   352→            }
   353→        }
   354→
   355→        // Update timeline position when filter bar is toggled
   356→        function updateTimelinePosition() {
   357→            const container = document.getElementById('timeline-container');
   358→            const filterToolbar = document.querySelector('.filter-toolbar');
   359→
   360→            if (container && filterToolbar) {
   361→                const filterHeight = filterToolbar.offsetHeight;
   362→                const computedStyle = getComputedStyle(filterToolbar);
   363→                const isFilterVisible = computedStyle.display !== 'none' &&
   364→                    computedStyle.visibility !== 'hidden' &&
   365→                    filterHeight > 0;
   366→
   367→                container.style.top = isFilterVisible ? `${filterHeight}px` : '0px';
   368→            }
   369→        }
   370→
   371→        // Initialize timeline resizing functionality
   372→        function initTimelineResize() {
   373→            const container = document.getElementById('timeline-container');
   374→            const resizeHandle = document.getElementById('timeline-resize-handle');
   375→
   376→            if (!container || !resizeHandle) return;
   377→
   378→            let startY = 0;
   379→            let startHeight = 0;
   380→
   381→            function handleMouseDown(e) {
   382→                isResizing = true;
   383→                startY = e.clientY;
   384→                startHeight = container.offsetHeight;
   385→
   386→                document.addEventListener('mousemove', handleMouseMove);
   387→                document.addEventListener('mouseup', handleMouseUp);
   388→
   389→                // Prevent text selection during resize
   390→                document.body.style.userSelect = 'none';
   391→                e.preventDefault();
   392→            }
   393→
   394→            function handleMouseMove(e) {
   395→                if (!isResizing) return;
   396→
   397→                const deltaY = e.clientY - startY;
   398→                const newHeight = Math.max(150, Math.min(window.innerHeight * 0.8, startHeight + deltaY));
   399→
   400→                container.style.height = newHeight + 'px';
   401→
   402→                // Trigger timeline redraw if needed
   403→                if (timeline) {
   404→                    timeline.redraw();
   405→                }
   406→            }
   407→
   408→            function handleMouseUp() {
   409→                isResizing = false;
   410→                document.removeEventListener('mousemove', handleMouseMove);
   411→                document.removeEventListener('mouseup', handleMouseUp);
   412→                document.body.style.userSelect = '';
   413→            }
   414→
   415→            // Add mouse event listeners
   416→            resizeHandle.addEventListener('mousedown', handleMouseDown);
   417→
   418→            // Also allow resizing by dragging the container bottom edge
   419→            container.addEventListener('mousedown', function (e) {
   420→                const rect = container.getBoundingClientRect();
   421→                if (e.clientY >= rect.bottom - 8) {
   422→                    handleMouseDown(e);
   423→                }
   424→            });
   425→        }
   426→
   427→        // Export functions to global scope
   428→        window.toggleTimeline = toggleTimeline;
   429→        window.applyTimelineFilters = applyFilters;
   430→        window.updateTimelinePosition = updateTimelinePosition;
   431→
   432→        // Hook into existing systems
   433→        document.addEventListener('DOMContentLoaded', function () {
   434→            // Listen for filter changes
   435→            const filterToggles = document.querySelectorAll('.filter-toggle');
   436→            filterToggles.forEach(toggle => {
   437→                toggle.addEventListener('click', function () {
   438→                    setTimeout(applyFilters, 50);
   439→                });
   440→            });
   441→
   442→            // Listen for select all/none buttons
   443→            const selectAllButton = document.getElementById('selectAll');
   444→            const selectNoneButton = document.getElementById('selectNone');
   445→            if (selectAllButton) {
   446→                selectAllButton.addEventListener('click', function () {
   447→                    setTimeout(applyFilters, 50);
   448→                });
   449→            }
   450→            if (selectNoneButton) {
   451→                selectNoneButton.addEventListener('click', function () {
   452→                    setTimeout(applyFilters, 50);
   453→                });
   454→            }
   455→
   456→            // Listen for filter toolbar visibility changes
   457→            const filterButton = document.getElementById('filterMessages');
   458→            const closeFiltersButton = document.getElementById('closeFilters');
   459→
   460→            if (filterButton) {
   461→                filterButton.addEventListener('click', function () {
   462→                    setTimeout(updateTimelinePosition, 50);
   463→                });
   464→            }
   465→
   466→            if (closeFiltersButton) {
   467→                closeFiltersButton.addEventListener('click', function () {
   468→                    setTimeout(updateTimelinePosition, 50);
   469→                });
   470→            }
   471→
   472→            // Update timeline position on window resize
   473→            window.addEventListener('resize', updateTimelinePosition);
   474→        });
   475→    })();
   476→</script>

