- **Sidechain assistant messages**: Get full markdown rendering via `render_markdown()` function (line 315)
- **Sidechain user messages**: Are displayed as-is in preformatted blocks with HTML escaping (lines 310-312)

The markdown rendering uses the mistune library with plugins for:
- Strikethrough, footnotes, tables, URLs, task lists, definition lists (lines 100-107)

### 4. **Special handling for sub-assistant messages**

There is special display formatting for sidechain messages (lines 902-908):

```python
if getattr(message, "isSidechain", False):
    css_class = f"{message_type} sidechain"

    # Update message type for display
    message_type = (
        "📝 Sub-assistant prompt"
        if message_type == "user"
        else "🔗 Sub-assistant"
    )
```

### 5. **CSS styling for sidechain messages**

In the CSS (lines 55-71 in message_styles.css):

```css
.sidechain {
    opacity: 0.85;
    background-color: #f8f9fa88;
    border-left-width: 2px;
    border-left-style: dashed;
}

.sidechain .sidechain-indicator {
    color: #666;
    font-size: 0.9em;
    margin-bottom: 5px;
    padding: 2px 6px;
    background-color: #e9ecef88;
    border-radius: 3px;
    display: inline-block;
}
```

### 6. **Tool content in sidechain messages**

Tool use, tool results, thinking content, and images within sidechain messages also inherit the sidechain styling (lines 1007-1008):

```python
if getattr(message, "isSidechain", False):
    tool_css_class += " sidechain"
```

### 7. **Timeline component integration**

The timeline component (lines 53-55 in timeline.html) specifically detects sidechain messages and groups them separately:

```javascript
// Check for sidechain first (sub-assistant messages)
if (classList.includes('sidechain')) {
    messageType = 'sidechain';
}
```

### Summary

Sidechain messages receive the same content processing as regular messages, including markdown rendering for assistant messages. The key differences are:

1. **Visual distinction**: Reduced opacity, dashed border, and distinct background
2. **Type labeling**: Different display names ("📝 Sub-assistant prompt" vs "🔗 Sub-assistant")
3. **Timeline grouping**: Separate group in the timeline visualization
4. **CSS class combination**: Both the base message type class and "sidechain" class

The content processing pipeline ensures that sidechain messages maintain full formatting capabilities while being visually distinguished from main conversation messages.

